INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("ヤマト", 2, 0.0, 1, "2030/01/01 14:59:59", -416.5, 3001100, 130011, 3001, "2024/10/31 12:00:00", 2.1, 100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("ヤマト", 2, 0.0, 4, "2030/01/01 14:59:59", -416.5, 3001101, 130011, 3001, "2024/10/31 12:00:00", 5.68, 101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("ヤマト", 1, 0.0, 1, "2030/01/01 14:59:59", -416.5, 3001102, 130011, 3001, "2024/10/31 12:00:00", 0.0, 102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 1, 0.0, 1, "2030/01/01 14:59:59", -416.5, 3002100, 130211, 3002, "2024/10/31 12:00:00", 0.0, 100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 1, 0.0, 1, "2030/01/01 14:59:59", -416.5, 3002101, 130211, 3002, "2024/10/31 12:00:00", 0.0, 101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 2, 0.0, 5, "2030/01/01 14:59:59", -416.5, 3002102, 130211, 3002, "2024/10/31 12:00:00", 8.53, 102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 1, 0.0, 7, "2030/01/01 14:59:59", -416.5, 3002103, 130211, 3002, "2024/10/31 12:00:00", 5.67, 103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 1, 0.0, 1, "2030/01/01 14:59:59", -416.5, 3002104, 130211, 3002, "2024/10/31 12:00:00", 0.0, 104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 3, 0.0, 3, "2030/01/01 14:59:59", -416.5, 3002300, 130211, 3004, "2024/10/31 12:00:00", 0.0, 300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 7, 0.0, 7, "2030/01/01 14:59:59", -416.5, 3002400, 130211, 3005, "2024/10/31 12:00:00", 0.0, 301, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 1, 0.0, 2, "2030/01/01 14:59:59", -416.5, 3003200, 130211, 3003, "2024/10/31 12:00:00", 4.4, 200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 7, 0.0, 7, "2030/01/01 14:59:59", -416.5, 3003201, 130211, 3003, "2024/10/31 12:00:00", 0.0, 201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ");
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", 2, 0.0, 1, "2030/01/01 14:59:59", -416.5, 3003202, 130211, 3003, "2024/10/31 12:00:00", 5.6, 202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪");
